import React from "react"
import "../styles/Login.css"
import {userTopRead } from "./consts"

export default function LoginButton({ endpoint, clientId, redirectUri, responseType }) {
  return (
    <a 
    className="login-button"
    href={ `${endpoint}?client_id=${clientId}&redirect_uri=${redirectUri}&scope=${userTopRead}&response_type=${responseType}` }>
        Login
    </a>
  )
}
